Function Show-ghostLoader {
	
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
	
	[void][reflection.assembly]::Load('System.Drawing, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a')
	[void][reflection.assembly]::Load('System.Windows.Forms, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b77a5c561934e089')
	[void][reflection.assembly]::Load('System.Data, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b77a5c561934e089')
	[void][reflection.assembly]::Load('System.DirectoryServices, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a')
	[void][reflection.assembly]::Load('Microsoft.Win32.Primitives, Version=4.0.0.0, Culture=neutral, PublicKeyToken=b03f5f7f11d50a3a')
	
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
	
	[System.Windows.Forms.Application]::EnableVisualStyles()
	$SNLoader = New-Object 'System.Windows.Forms.Form'
	$panel4 = New-Object 'System.Windows.Forms.Panel'
	$textbox1 = New-Object 'System.Windows.Forms.TextBox'
	$panel1 = New-Object 'System.Windows.Forms.Panel'
	$label2 = New-Object 'System.Windows.Forms.Label'
	$panel3 = New-Object 'System.Windows.Forms.Panel'
	$label1 = New-Object 'System.Windows.Forms.Label'
	$panel2 = New-Object 'System.Windows.Forms.Panel'
	$buttonLoad = New-Object 'System.Windows.Forms.Button'
	$buttonSave = New-Object 'System.Windows.Forms.Button'
	$openFile = New-Object 'System.Windows.Forms.OpenFileDialog'
	$InitialFormWindowState = New-Object 'System.Windows.Forms.FormWindowState'
	#endregion Generated Form Objects
		
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
		
	$SNLoader_Load = {
		
	}
	
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
		
	$buttonLoad_Click = {
		
		If ($openFile.ShowDialog() -eq 'OK') {
			$userSNPath = $openFile.FileName
			$global:userSN = (Get-Content -Path $userSNPath -Raw)
			$textbox1.Text = $userSN
			$textbox1.remove_MouseEnter($textbox1_MouseEnter)
			$textbox1.remove_MouseLeave($textbox1_MouseLeave)
			Write-Host "User Loaded $($userSN.Count) SNs from Text File located at: $($usersSNPath)."
		}
	}
	
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
		
	$buttonSave_Click = {
		(Set-Content -Value $textbox1.Text -Path "$($env:APPDATA)\Ghostwriter\snOutput.txt" -Force)
		$snGet = Get-Content "$($env:APPDATA)\Ghostwriter\snOutput.txt" |
			ForEach-Object {
			$_ = '"' + $_ + '"'
			$_ = ($_ -replace '"{2}', "" -replace '^$\r\n', "")
			$_
			} | Set-Content -Encoding utf8  "$($env:APPDATA)\Ghostwriter\SerialNumbers.txt" -Force
		$global:serialNumbers = Get-Content "$($env:APPDATA)\Ghostwriter\SerialNumbers.txt"
		(Write-Host "Successfully Loaded and Processed $($serialNumbers.Count) Serial Numbers.")
		
		Start-Sleep -Seconds 1
		
		$SNLoader.Close()
	}
	
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
	
	$textbox1_MouseEnter = {
		If ($textbox1.Modified -ne $true) {
			$textbox1.Text = ""
		} Else {
			$textbox1.remove_MouseEnter($textbox1_MouseEnter)
			$textbox1.remove_MouseLeave($textbox1_MouseLeave)
		}
	}
		
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
#========#@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@#========#
	
	$textbox1_MouseLeave = {
		If ($textbox1.Modified -ne $true) {
			$textbox1.Text = '
CW7DD52
CNK522000K
CNK4430FP9
D4PXW23
BP113QL
PN05SX20121US
CN0XPG0H7444553S907U
CN0VXV4972872186JT5L
CW7DD52
CNK522000K
CNK4430FP9
D4PXW23
BP113QL
'
		} Else {
			$textbox1.remove_MouseEnter($textbox1_MouseEnter)
			$textbox1.remove_MouseLeave($textbox1_MouseLeave)
		}
	}
	
